#include "http_parser.h"
#include <stdint.h>
#include <string.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size < sizeof(enum http_errno)) {
    return 0;
  }

  enum http_errno errnum;
  memcpy(&errnum, data, sizeof(enum http_errno));
  if(errnum < 0 || errnum >= HTTP_ERRNO_MAX) {
    return 0;
  }
  const char * errname = http_errno_name(errnum);

  return errname == NULL;
}

